(22, '96671997', 17121007490367, '2017.12.9. 꿈꾸는 몽생이(공동육아)_엄마아빠도 아이도 힐링하고 왔어요^^', '2017.12.9. 꿈꾸는 몽생이(공동육아)_아빠엄마도 아이도 힐링하고 왔어요^^\n\n힐링 테라피 만들기 : 귤꽃 허브 미스트 만들기\n아이들 주 연령대가 3-4세 유아들이라 걱정했는데...\n선생님께서 아이들과 엄마들 할 일을 따로 제시해 주시고 수업 잘 이끌어 주셔서...\n엄마아빠도 아이들도 상쾌한 귤꽃 향기 맡으며 즐거운 시간이었습니다.^^\n\n프로그램 끝난후 점심시간...\n따뜻한 밥과 국, 건강한 반찬들로 배채울 수 있어서 너무 좋았구요^^\n\n오후에 아랑이 놀이터에서 놀이도 아이들이 무척 즐거워 했어요.^^\n대부분 아이들의 놀이감들이... 원목 재질이라 서로 부딪히는 소리, 촉감들이 좋았구요.\n편백나무 향 가득한 나무방에서 아이들이 정말 자연치유하는 시간이었던거 같아요.\n아이들이 잘 놀아주니 엄마들도 한 켠에서 한숨 돌릴 수 있어 감사했네요^^\n\n인원이 많고 꼬마 악동들의 방문으로 센터가 시끌벅적 했던거 같아요.ㅎ\n많이 양해해 주신 센터 관계자분들께 감사드립니다.^^\n\n간단한 후기로나마 감사인사 전해드립니다.\n집으로 돌아오는 길 \n아이들과 함께 누릴 것이 많은 제주라는 생각과 함께 행복한 하루였습니다.', '2017-12-10 08:53:34'),
