('company', 1, '회사소개', '<p align=center><b>회사소개에 대한 내용을 입력하십시오.</b></p>', '', '', '', 0, 0, '', ''),
('greeting', 1, '센터장 인사말', '<p><img src="http://www.jejuatopycenter.kr/data/editor/1710/46434585987018e130fd18cacb432089_1508550637_844.png" title="46434585987018e130fd18cacb432089_1508550637_844.png"><br style="clear:both;">&nbsp;</p>', '', 'basic', 'basic', 0, 0, '', ''),
