('BI_introduce', 1, 'BI소개', '<p><img src="http://www.jejuatopycenter.kr/data/editor/1710/46434585987018e130fd18cacb432089_1508550768_6923.png" title="46434585987018e130fd18cacb432089_1508550768_6923.png"><br style="clear:both;">&nbsp;</p>', '', 'basic', 'basic', 0, 0, '', ''),
