('food_content', 1, '냠냠뇸뇸 식단', '\r\n<div style="font-weight:bold; font-size:15px; padding-bottom:20px;">※「냠냠뇸뇸 식당」의 주간 식단표</div>\r\n\r\n<table width="100%" bgcolor="#e2dfd8" cellspacing="1" cellpadding="0">\r\n<thead>\r\n<tr height="50">\r\n	<th style="background: rgb(244, 244, 244); padding: 10px; color: rgb(94, 94, 94); font-size: 15px; border-bottom:2px solid #ebebeb;">요일</th>\r\n	<th style="background: rgb(244, 244, 244); padding: 10px; color: rgb(94, 94, 94); font-size: 15px; border-bottom:2px solid #ebebeb;">\r\n		화\r\n	</th>\r\n	<th style="background: rgb(244, 244, 244); padding: 10px; color: rgb(94, 94, 94); font-size: 15px; border-bottom:2px solid #ebebeb;">\r\n		수\r\n	</th>\r\n	<th style="background: rgb(244, 244, 244); padding: 10px; color: rgb(94, 94, 94); font-size: 15px; border-bottom:2px solid #ebebeb;">\r\n		목\r\n	</th>\r\n	<th style="background: rgb(244, 244, 244); padding: 10px; color: rgb(94, 94, 94); font-size: 15px; border-bottom:2px solid #ebebeb;">\r\n		금\r\n	</th>\r\n	<th style="background: rgb(244, 244, 244); padding: 10px; color: rgb(94, 94, 94); font-size: 15px; border-bottom:2px solid #ebebeb;">\r\n		토\r\n	</th>\r\n</tr>\r\n</thead>\r\n<tbody>\r\n<tr>\r\n	<td class="col_2" style="background: rgb(255, 255, 255); font-size: 15px; text-align:center; padding:5px;">\r\n		메뉴\r\n	</td>\r\n	<td class="col_2" style="background: rgb(255, 255, 255); font-size: 15px; text-align:center; padding:5px;">\r\n		수수밥<br>\r\n		북어국<br>\r\n		해물두부볶음<br> \r\n		메추리알장<br>\r\n		조림<br>\r\n		부추무침<br>\r\n		깍두기<br>\r\n	</td>\r\n	<td class="col_2" style="background: rgb(255, 255, 255); font-size: 15px; text-align:center; padding:5px;">\r\n		차조밥<br>\r\n		열무된장국<br>\r\n		닭살고구마<br>\r\n		조림<br>\r\n		미나리오이<br>\r\n		생채<br>\r\n		콩나물무침<br>\r\n		배추김치<br>\r\n	</td>\r\n	<td class="col_2" style="background: rgb(255, 255, 255); font-size: 15px; text-align:center; padding:5px;">\r\n		현미쌀밥<br>\r\n		순두부찌개<br>\r\n		계란참치볶음<br>\r\n		우육채마늘쫑<br>\r\n		조림<br>\r\n		과일샐러드<br>\r\n		배추김치\r\n	</td>\r\n	<td class="col_2" style="background: rgb(255, 255, 255); font-size: 15px; text-align:center; padding:5px;">\r\n		보리쌀밥<br>\r\n		늙은호박<br>\r\n		된장국<br>\r\n		돈육자장볶음<br>\r\n		숙주나물잡채<br>\r\n		동초겉절이<br>\r\n		깍두기\r\n	</td>\r\n	<td class="col_2" style="background: rgb(255, 255, 255); font-size: 15px; text-align:center; padding:5px;">\r\n		검정콩밥<br>\r\n		닭곰탕<br>\r\n		가자미<br>\r\n		카레구이<br>\r\n		어묵간장조림<br>\r\n		해초무침<br>\r\n		배추김치\r\n	</td>\r\n</tr>\r\n</tbody>\r\n</table>', '', 'basic', 'basic', 0, 0, '', ''),
('coronation_apply', 1, '대관신청', '<div style="line-height: 160%; padding-bottom: 30px;">\r\n	<div style="text-align: left; padding-top: 2px; padding-bottom: 30px; font-size: 15px;">\r\n		제주 비자숲힐링센터의 대관신청 안내입니다. \r\n	</div>\r\n	\r\n	<div style="text-align: left; padding-top: 2px; padding-bottom: 10px; font-weight: bold; font-size: 15px;">\r\n		<img src="http://www.jejuatopycenter.kr/images/bullet_content.png">&nbsp;대관 시설 현황\r\n	</div>\r\n\r\n	<div style="padding-bottom: 15px;">\r\n		<table width="100%" bgcolor="#e2dfd8" cellspacing="1" cellpadding="0" style="table-layout:fixed;">\r\n			<thead>\r\n			<tr align="center" height="50px">\r\n				<th style="background: rgb(244, 244, 244); padding: 10px; color: rgb(94, 94, 94); font-size: 14px; width:33%;">구분</th>\r\n				<th style="background: rgb(244, 244, 244); padding: 10px; color: rgb(94, 94, 94); font-size: 14px; width:34%;">좌석수</th>\r\n				<th style="background: rgb(244, 244, 244); padding: 10px; color: rgb(94, 94, 94); font-size: 14px; width:33%;">기본사용료(시간당)</th>\r\n			</tr>\r\n			</thead>\r\n			<tbody>\r\n			<tr align="center" height="50px">\r\n				<td class="col_2" style="background: rgb(255, 255, 255); font-size: 14px;">대강의실</td>\r\n				<td class="col_2" style="background: rgb(255, 255, 255); font-size: 14px;">80</td>\r\n				<td class="col_2" style="background: rgb(255, 255, 255); font-size: 14px;">20,000</td>\r\n			</tr>\r\n			<tr align="center" height="50px">\r\n				<td class="col_2" style="background: rgb(255, 255, 255); font-size: 14px;">소강의실</td>\r\n				<td class="col_2" style="background: rgb(255, 255, 255); font-size: 14px;">90</td>\r\n				<td class="col_2" style="background: rgb(255, 255, 255); font-size: 14px;">20,000</td>\r\n			</tr>\r\n			</tbody>\r\n		</table>\r\n	</div>\r\n	\r\n	<div>\r\n		<div style="text-align: left; padding-top: 2px; padding-bottom: 10px; font-weight: bold; font-size: 15px;">\r\n			<img src="http://www.jejuatopycenter.kr/images/bullet_content.png">&nbsp;시설이용 안내 및 유의사항\r\n		</div>\r\n		\r\n		<div style="text-align: left; padding-top: 2px; padding-bottom: 2px; font-size: 14px; line-height: 160%;"><img src="http://www.jejuatopycenter.kr/images/so_bullet.png"> 대관신청은 사용일 기준 최대 60일~ 최소 5일 이전까지 가능합니다.</div>\r\n		<div style="text-align: left; padding-top: 2px; padding-bottom: 2px; font-size: 14px; line-height: 160%;"><img src="http://www.jejuatopycenter.kr/images/so_bullet.png"> 대관신청에 관한 자세한 사항은 전화로 문의주시기 바랍니다.</div>\r\n		<div style="text-align: left; padding-top: 2px; padding-bottom: 2px; font-size: 14px; line-height: 160%;"><img src="http://www.jejuatopycenter.kr/images/so_bullet.png"> 준비 및 정리 시간을 포함한 총 사용시간으로 대관신청을 해야 합니다.</div>\r\n		<div style="text-align: left; padding-top: 2px; padding-bottom: 2px; font-size: 14px; line-height: 160%;"><img src="http://www.jejuatopycenter.kr/images/so_bullet.png"> 사용료 납부는 현장 카드결제를 원칙으로 합니다. 단 필요시 무통장입금 처리가 가능합니다.</div>\r\n		<div style="text-align: left; padding-top: 2px; padding-bottom: 2px; font-size: 14px; line-height: 160%;"><img src="http://www.jejuatopycenter.kr/images/so_bullet.png"> 사용자는 사용권을 양도하거나 대여할 수 없으며, 사용시간은 센터 개방시간 중에 사용함을 원칙으로 합니다.</div>\r\n		<div style="text-align: left; padding-top: 2px; padding-bottom: 2px; font-size: 14px; line-height: 160%;"><img src="http://www.jejuatopycenter.kr/images/so_bullet.png"> 사용자는 행사에 대한 안내를 센터에 임의로 전가할 수 없으며, 사용자가 본 시설을 대관하여 안내문을 발송하는 경우 반드시 사용자의 연락처를 기재하여 장소 등에 대한 안내를 진행해야 합니다.</div>\r\n	</div>\r\n\r\n	<div style="padding-top:30px; font-size: 15px; line-height:160%;">\r\n		<div style="line-height: 160%;">다음의 사항에 관련된 경우, 시설이용을 제한합니다.</div>\r\n		<div style="line-height: 160%;">- 법령 또는 사회적 통념을 위반하는 내용의 행사</div>\r\n		<div style="line-height: 160%;">- 호화, 사치, 퇴폐 풍조를 유발하여 사회적 문제 발생이 있는 행사</div>\r\n		<div style="line-height: 160%;">- 센터 업무에 지장을 초래하는 행사</div>\r\n		<div style="line-height: 160%;">- 시설 및 설비를 심각히 훼손할 수 있는 행사</div>\r\n		<div style="line-height: 160%;">- 기타 시설을 사용하기에 부적합(상업, 정치, 종교관련 행위 등)하다고 판단되는 행사행해야 합니다.</div>\r\n	</div>\r\n\r\n	<div style="padding-top:30px; font-size: 14px; line-height:160%;">\r\n		<div style="line-height: 160%;">▶ 비자숲힐링센터(이하 센터)는 아토피피부염 등 환경성질환 예방ㆍ관리교육 전문기관으로 센터 설립목적에 부합하지 않는 행사는 사용허가가 불가합니다.</div>\r\n		<div style="line-height: 160%;">▶ 센터 주변 도로 및 주차공간이 협소하여 사용인원이 50명 이상 되는 행사는 시설 사용이 불가합니다.</div>\r\n		<div style="line-height: 160%;">▶ 대관의 우선권은 센터 관련 기관에 있으며, 단체와 개인 간 동시 신청 시, 단체를 우선으로 합니다.</div>\r\n	</div>\r\n</div>', '', 'basic', 'basic', 0, 0, '', '');
INSERT INTO `g5_faq` (`fa_id`, `fm_id`, `fa_subject`, `fa_content`, `fa_order`) VALUES
(1, 1, '상담전화는 어디로 하면 되나요?', '상담전화는 064-782-8963으로 해주시면 친절하게 답해드리겠습니다.\r\n<p>감사합니다.</p>', 1),
(2, 1, '운영시간은 언제인가요?', '운영시간은 오전 9시부터 오후 6시까지입니다. 월요일은 휴관일입니다.\r\n<p>감사합니다.</p>', 2),
(3, 1, '예약은 어떻게 하나요?', '예약방법은 온라인 예약 메뉴에 있는 이용안내에서 확인하실 수 있습니다.\r\n<p>감사합니다. </p>', 3),
(4, 1, '예약은 언제부터 가능한가요?', '예약은 월별로 한달 전부터 예약 가능하며, 홈페이지에서 신청 및 취소가 가능합니다.\r\n<p>감사합니다. </p>', 4),
(5, 1, '놀이터에 아이만 입장할 수 있나요?', '놀이터 내에는 반드시 보호자가 동반 입장하여야 합니다.\r\n<p>자녀 1명당 보호자 1명이 동반하셔야 되시며, 자녀가 2명일 경우 보호자가 2명이 동반하시되 보호자 1명이 2명 모두 케어 가능하시면 이용 가능합니다.</p>\r\n<p>감사합니다.</p>', 5),
