(3, 'both', '2017-11-18 00:00:00', '2018-02-23 23:59:59', 24, 40, 150, 350, 450, '아랑이 놀이터 이용안내', '<div style="background: rgb(255, 255, 255); padding: 20px;">\r\n	<div style="text-align: center; font-size: 25px; font-weight: bold;">\r\n		<div style="margin-right: 300px;"><img src="http://www.jejuatopycenter.kr/images/arang-i.png"></div>\r\n		<div><span style="color: rgb(53, 135, 145);">아랑이</span> 놀이터 이용안내</div>\r\n	</div>\r\n\r\n	<div style="line-height: 160%; padding-top: 10px;">\r\n	<div>◦ 이용 연령: 1세 ~ 7세</div>\r\n	<div>◦ 정원: 20명</div>\r\n	</div>\r\n\r\n	<div style="padding-top: 10px;">\r\n		<table width="100%" class="__se_tbl_ext" style="border-collapse: collapse;" border="1" cellspacing="1" cellpadding="0">\r\n		<tbody><tr align="center">\r\n			<td height="55" style="background: rgb(208, 234, 237);">\r\n				<div style="font-weight: bold;">\r\n					<div>1회</div>\r\n					<div>10:00~12:00</div>\r\n				</div>\r\n			</td>\r\n			<td style="background: rgb(194, 223, 165);" rowspan="3">\r\n				<div style="font-weight: bold;">\r\n					<div>12:00~13:00</div>\r\n					<div>&nbsp;</div>\r\n					<div>&nbsp;</div>\r\n					<div>점심시간</div>\r\n				</div>\r\n			</td>\r\n			<td height="55" style="background: rgb(208, 234, 237);">\r\n				<div style="font-weight: bold;">\r\n					<div>2회</div>\r\n					<div>13:00~15:00</div>\r\n				</div>\r\n			</td>\r\n			<td height="55" style="background: rgb(208, 234, 237);">\r\n				<div style="font-weight: bold;">\r\n					<div>3회</div>\r\n					<div style="color: rgb(147, 48, 48);">15:30~17:30</div>\r\n				</div>\r\n			</td>\r\n		</tr>\r\n		<tr align="center">\r\n			<td height="28" style="font-weight: bold;"><span style="color: rgb(105, 155, 55);">주중: 단체</span></td>\r\n			<td rowspan="2">\r\n				<span style="color: blue; font-weight: bold;">개인</span>\r\n			</td>\r\n			<td rowspan="2">\r\n				<span style="color: blue; font-weight: bold;">개인</span>\r\n			</td>\r\n		</tr>\r\n		<tr align="center">\r\n			<td height="28"><span style="color: blue; font-weig