(10, 'both', '2017-11-29 00:00:00', '2018-02-03 23:59:59', 24, 100, 150, 250, 430, '센터 이용시 참고', '<div>\r\n<p><img title="4b63019ee28067407be396d918cd5a69_1512007958_5873.png" src="http://www.jejuatopycenter.kr/data/editor/1711/4b63019ee28067407be396d918cd5a69_1512007958_5873.png">&nbsp;</p><table width="409" height="111" class="__se_tbl_ext" style="margin: 1.01mm; border-collapse: collapse;" cellspacing="0" cellpadding="7"><colgroup><col width="166"><col width="242"></colgroup><tbody><tr height="33" style="height: 24.15pt;"><td width="167" height="33" style="padding: 0.49mm 1.8mm; border: 1px solid black; width: 124.9pt; height: 24.15pt; mso-border-alt: solid black 1px;"><p style="text-align: center; line-height: 160%; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 11pt; font-weight: bold;">매주&nbsp;월요일</span></p></td><td width="243" height="33" style="padding: 0.49mm 1.8mm; border: 1px solid black; width: 181.55pt; height: 24.15pt; mso-border-alt: solid black 1px;"><p style="text-align: center; line-height: 160%; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 11pt; font-weight: bold;">매주&nbsp;화요일</span></p></td></tr><tr height="79" style="height: 58.95pt;"><td width="167" height="79" style="padding: 0.49mm 1.8mm; border: 1px solid black; width: 124.9pt; height: 58.95pt; mso-border-alt: solid black 1px;"><p style="text-align: center; line-height: 160%; margin-top: 0pt; margin-bottom: 0pt;"><span style="color: rgb(255, 0, 82); font-size: 12pt;">정기휴관</span></p><p style="text-align: center; line-height: 160%; margin-top: 0pt; margin-bottom: 0pt;"><span style="color: rgb(255, 0, 82); font-size: 12pt;">(전면휴관)</span></p></td><td width="243" height="79" style="padding: 0.49mm 1.8mm; border: 1px solid black; width: 181.55pt; height: 58.95pt; mso-border-alt: solid black 1px;"><p style="text-align: center; line-height: 160%; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 12pt;">어린이&nbsp;놀이터만&nbsp;개방</span></p><p style="text-align: c