(11, 'both', '2017-12-09 00:00:00', '2017-12-31 23:59:59', 24, 550, 120, 250, 420, '놀이터 예약 마감 안내', '<p align="center" style="text-align: center;"><span style="font-size: 12pt;">&nbsp;알립니다.<span style="font-size: 12pt;"><span style="font-size: 12pt;"><span style="font-size: 12pt;"><img width="341" height="299" title="49605a58eddedd5b0a7206eb95bcd95e_1512783499_3116.JPG" style="width: 103px; height: 88px;" src="http://www.jejuatopycenter.kr/data/editor/1712/49605a58eddedd5b0a7206eb95bcd95e_1512783499_3116.JPG"></span></span></span><br style="clear: both;">​</span></p><p align="center" style="text-align: center; line-height: 1.8;"><span style="font-size: 12pt;">12월 31일 일요일 모든 프로그램이 마감되었습니다.</span></p><p align="center" style="text-align: center; line-height: 1.8;"><span style="font-size: 12pt;">센터 이용에 참고하시기 바랍니다. 감사합니다.&nbsp;&nbsp;</span></p>', 0),
(12, 'both', '2017-12-15 00:00:00', '2017-12-24 23:59:59', 24, 100, 100, 450, 500, '비자숲힐링센터 크리스마스 행사 안내', '<div style="text-align: center;">\r\n\r\n<img src="/data/editor/1712/12faf36a7d804988c362081448016fb5_1513306272_1638.png" usemap="#popupMap"></div><div style="text-align: center;"><p style="line-height: 180%;"><span style="font-size: 11pt;">** 예약자 댓글 남겨주실 때 유아이름을 남겨주세요.</span></p><p style="line-height: 180%;"><span style="font-size: 11pt;">** 24일은 친환경식당은 운영하지 않습니다. 참고하시기 바랍니다.</span> </p><p style="line-height: 180%;"><span style="font-size: 11pt;">** 어린이 놀이터&nbsp;이용은 별도로 전화&nbsp;예약주시기 바랍니다. ​</span>&nbsp;&nbsp;\r\n\r\n<map name="popupMap">\r\n    <area href="/bbs/board.php?bo_table=notice" shape="rect" coords="96,140,258,173" target="_self" alt="공지사항">\r\n    <area href="/bbs/board.php?bo_table=notice&amp;wr_id=59" shape="rect" coords="261,141,329,172" target="_self" alt="1회">\r\n    <area href="/bbs/board.php?bo_table=notice&amp;wr_id=60" shape="rect" coords="335,140,403,173" target="_self" alt="2회">\r\n</map></p>\r\n</div>', 0),
