(48, -2, '', 48, 0, 0, '', '', 'html1', '비자숲힐링센터 환경 백일장 수상자 안내', '<p><span style="font-family: Gulim, sans-serif; font-size: 13.33px; background-color: rgb(255, 255, 255);">10월 21일에 개최된</span><span style="font-family: Gulim, sans-serif; font-size: 13.33px; background-color: rgb(255, 255, 255);">&nbsp;</span><span style="font-family: Gulim, sans-serif; font-size: 12pt;">제주환경성질환예방관리센터 개관</span><span lang="EN-US" style="font-family: HY헤드라인M; font-size: 12pt;">&nbsp;</span><span style="font-family: Gulim, sans-serif; font-size: 12pt;">기념&nbsp;</span><span lang="EN-US" style="letter-spacing: 0pt; font-family: HY헤드라인M; font-size: 12pt;">‘</span><span style="font-family: Gulim, sans-serif; font-size: 12pt;">비자숲힐링&nbsp;</span><span lang="EN-US" style="letter-spacing: 0pt; font-family: HY헤드라인M; font-size: 12pt;">-&nbsp;</span><span style="font-family: Gulim, sans-serif; font-size: 12pt;">자연이 주는 선물</span><span lang="EN-US" style="letter-spacing: 0pt; font-family: HY헤드라인M; font-size: 12pt;">’어린이 환경 백일장 수상자를&nbsp;</span><span style="font-family: Gulim, sans-serif; font-size: 13.33px; background-color: rgb(255, 255, 255);">다음과 같이 안내합니다.</span></p><p style="line-height: 1.5; letter-spacing: 0pt; font-family: Gulim, sans-serif; font-size: 14pt; font-weight: bold; background-color: rgb(255, 255, 255);"><span lang="EN-US" style="font-family: 휴먼매직체; font-size: 14pt;">&nbsp;</span><span style="font-family: 휴먼매직체; font-size: 14pt;"></span></p><p style="text-align: center; line-height: 1.5; font-family: Gulim, sans-serif; font-size: 24pt; font-weight: bold; background-color: rgb(255, 255, 255);"><span lang="EN-US" style="letter-spacing: 0pt; font-family: 휴먼매직체; font-size: 24pt;">“</span><span style="font-size: 24pt;">어린이 환경 백일장</span><span lang="EN-US" style="letter-spacing: 0pt; font-family: 휴먼매직체; font-size: 24pt;">”&nbsp;</span><span style="font-size: 24pt;">수상자 안내</span></p><p style="line-height: 1.5; letter-spacing: -0.9pt; font-family: Gulim, sans-serif; font-size: 14pt; backgroun