(59, -7, '', 59, 0, 67, '', '', 'html1', '(마감)비자숲힐링센터 크리스마스 1회 행사 안내', '<p class="0"><span lang="EN-US" style="font-family: 함초롬바탕;"> </span><span lang="EN-US" style="font-family: 다음_Regular; font-size: 11pt;"> </span><span style="font-size: 11pt; mso-fareast-font-family: 다음_Regular;">비자숲힐링센터에서는 어린이의 눈높이에 맞춘 자유롭고 활발한 체험공간을 제공하고 숲체험 등을 통해 자연과 접하는 즐거움을 느끼도록 하며</span><span lang="EN-US" style="letter-spacing: 0pt; font-family: 다음_Regular; font-size: 11pt; mso-ascii-font-family: 다음_Regular; mso-font-width: 100%; mso-text-raise: 0.0pt;">, </span><span style="font-size: 11pt; mso-fareast-font-family: 다음_Regular;">인형극과 동화구연 등을 통해 아토피</span><span lang="EN-US" style="letter-spacing: 0pt; font-family: 다음_Regular; font-size: 11pt; mso-ascii-font-family: 다음_Regular; mso-font-width: 100%; mso-text-raise: 0.0pt;">, </span><span style="font-size: 11pt; mso-fareast-font-family: 다음_Regular;">천식 및 비염 등의 환경성질환 예방교육프로그램을 진행하고 있습니다</span><span lang="EN-US" style="letter-spacing: 0pt; font-family: 다음_Regular; font-size: 11pt; mso-ascii-font-family: 다음_Regular; mso-font-width: 100%; mso-text-raise: 0.0pt;">.</span></p><p class="0" style="line-height: 180%; mso-pagination: none; mso-padding-alt: 0.0pt 0.0pt 0.0pt 0.0pt;"><span lang="EN-US" style="font-family: 다음_Regular; font-size: 11pt;">  </span><span style="font-size: 11pt; mso-fareast-font-family: 다음_Regular;">연말과 크리스마스를 맞아 어린이가 즐길 수 있는 놀이와 흥미유발형 체험프로그램을 통해 환경성질환 예방에 대한 관심을 유도하고 건강관리의 중요성을 인식하는 기회를 마련하고자 지역 주민의 건강 함께하는 무료체험 행사를 진행합니다</span><span lang="EN-US" style="letter-spacing: 0pt; font-family: 다음_Regular; font-size: 11pt; mso-ascii-font-family: 다음_Regular; mso-font-width: 100%; mso-text-raise: 0.0pt;">.</span></p><p class="0" style="line-height: 180%; mso-pagination: none; mso-padding-alt: 0.0pt 0.0pt 0.0pt 0.0pt;"><!--[if !supportEmptyParas]--><!--[endif]--><span style="font-size: 11pt;">** 예약자 댓글 남겨주실 때 유아이름을 남겨주세요.</span></p><p class="0" style="line-height: 180%; mso-pagination: none; mso-padding-alt: 0.0pt 0.0pt 0.0pt 0.0pt;"><span style="font-size: 11pt;">** 24일은 친환경식당은 운영하지 않습니다. 참고하시기 바랍니다.</span> </p><p class="0" style="line-height: 180%; mso-pagination: none; mso-padding-alt: 0.0pt 0.0pt 0.0pt 0.0pt;"><span style="font-size: 11pt;">** 놀이터 이용은 전화로 별도 예약주시기 바랍니다. ​</span>&nbsp;&nbsp;<o:p></o:p></p><p class="0" style="line-height: 200%; text-indent: -41.1pt; margin-left: 41.1pt; mso-pagination: none; mso-padding-alt: 0.0pt 0.0pt 0.0pt 0.0pt;"><span lang="EN-US" style="font-family: 다음_Regular; font-size: 11pt;">&nbsp;</span><span lang="EN-US" style="letter-spacing: 0pt; font-family: 다음_Regular; font-size: 11pt; mso-ascii-font-family: 다음_Regular; mso-font-width: 100%; mso-text-raise: 0.0pt;">​</span></p><p class="0" style="line-height: 200%; text-indent: -41.1pt; margin-left: 41.1pt; mso-pagination: none; mso-padding-alt: 0.0pt 0.0pt 0.0pt 0.0pt;"><span lang="EN-US" style="letter-spacing: 0pt; font-family: 다음_Regular; font-size: 11pt; mso-ascii-font-family: 다음_Regular; mso-font-width: 100%; mso-text-raise: 0.0pt;">1. </span><span style="font-size: 11pt; mso-fareast-font-family: 다음_Regular;">일 시 </span><span lang="EN-US" style="letter-spacing: 0pt; font-family: 다음_Regular; font-size: 11pt; mso-ascii-font-family: 다음_Regular; mso-font-width: 100%; mso-text-raise: 0.0pt;">: 2017. 12. 24.(</span><span style="font-size: 11pt; mso-fareast-font-family: 다음_Regular;">일</span><span lang="EN-US" style="letter-spacing: 0pt; font-family: 다음_Regular; font-size: 11pt; mso-ascii-font-family: 다음_Regular; mso-font-width: 100%; mso-text-raise: 0.0pt;">)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><span lang="EN-US" style="letter-spacing: 0pt; font-family: 다음_Regular; font-size: 11pt; mso-ascii-font-family: 다음_Regular; mso-font-width: 100%; mso-text-raise: 0.0pt;">1</span><span style="font-size: 11pt; mso-fareast-font-family: 다음_Regular;">회 </span><span lang="EN-US" style="letter-spacing: 0pt; font-family: 다음_Regular; font-size: 11pt; mso-ascii-font-family: 다음_Regular; mso-font-width: 100%; mso-text-raise: 0.0p