 mso-font-width: 100%; mso-text-raise: 0.0pt; mso-pagination: none; mso-padding-alt: 0.0pt 0.0pt 0.0pt 0.0pt; mso-style-name: "바탕글"; mso-font-kerning: 0.0pt;''>  <!--[if !supportEmptyParas]-->&nbsp;<!--[endif]-->  <o:p></o:p></p></td></tr></tbody></table><p>&nbsp;</p><p class="0" style="line-height: 180%; text-indent: -41.1pt; margin-left: 41.1pt; mso-pagination: none; mso-padding-alt: 0.0pt 0.0pt 0.0pt 0.0pt;"><span style="font-size: 11pt; mso-fareast-font-family: 다음_Regular;">&nbsp;</span></p>', '', '', 0, 0, 377, 0, 0, 'admin', '*AF0631401415FAC79CE1B9315556EACF17939505', '관리자', 'admin@domain.com', '', '2017-12-15 11:47:41', 0, '2017-12-22 09:43:01', '1.233.90.241', '', '', '', '', '', '', '', '', '', '', '', ''),
(50, -3, '', 50, 0, 0, '', '', 'html1', '비자숲힐링센터 프로그램 이용 안내', '<p>안녕하십니까?</p><p>비자숲힐링센터를 찾아주셔서 감사합니다.</p><p>우선 센터 홈페이지 구성이 원활하지 못한 점 깊이 사과드립니다.</p><p>홈페이지 예약시스템은 1월 중 시작될&nbsp;예정으로 당분간 전화를 통해 예약을 받고 있습니다.</p><p>070-4207-3675&nbsp; 혹은 &nbsp;064-782-8963로 연락주시기 바랍니다.</p><p>&nbsp;</p><p>현재 진행되고 있는 프로그램은 단체예방교육프로그램과 개별프로그램으로 구성되어 있습니다.</p><p>&nbsp;</p><p>어린이집, 유치원, 초등학교 등 단체예방교육프로그램은 매주 수요일(인형극), 목요일(숲놀이),&nbsp; 금요일(동화구연)을 통하여 환경성질환에 대한 예방교육을 진행하고 아랑이, 다랑이놀이터 이용과 친환경식사를 포함하여 1인 10,000원입니다. </p><p>&nbsp;</p><p>개별 이용은 수~금요일(오후1시~3시, 3시 30분~5시 30분), 토~일요일(10시~12시, 오후1시~3시, 3시 30분~5시 30분) 이용 가능하며</p><p>&nbsp;</p><p>월요일은 휴관입니다^^</p><p>화요일은 아랑이놀이터(7세이하), 다랑이놀이터(7세~13세)만 개방합니다.</p><p>&nbsp;</p><p>아랑이놀이터(7세이하), 다랑이놀이터(7세~13세)는&nbsp;입장료 2,000원입니다.</p><p>또한, 일반인을 위한 기초검사(체지방측정, 스트레스검사, 말초혈액순환검사)는 무료로 진행하며&nbsp;</p><p>습식, 건식테라피가 이용가능한 힐링테라피프로그램은&nbsp;이용료가 5,000원입니다.</p><p>친환경식사는 일반 7,000원 초등이하 5,000원으로 이용하실 수 있습니다.(점심만 가능, 12:00~13:00)</p><p>궁금하신 점이 있으시면 언제든지 문의해 주시기 바랍니다. 감사합니다.</p><p><br>&nbsp;</p>', '', '', 0, 0, 825, 0, 0, 'admin', '*AF0631401415FAC79CE1B9315556EACF17939505', '관리자', 'admin@domain.com', '', '2017-11-10 15:34:54', 0, '2017-11-10 15:34:54', '221.162.12.86', '', '', '', '', '', '', '', '', '', '', '', ''),
(70, -7, '', 59, 1, 1, 'A', '', '', '', '예약되었습니다. 감사합니다. 힐링테라피프로그램과 식당은 운영하지 않습니다. 참고바랍니다.', '', '', 0, 0, 0, 0, 0, 'admin', '*AF0631401415FAC79CE1B9315556EACF17939505', '관리자', 'admin@domain.com', '', '2017-12-15 17:49:56', 0, '', '221.162.12.86', '', '', '', '', '', '', '', '', '', '', '', ''),
