INSERT INTO `g5_write_press_release` (`wr_id`, `wr_num`, `wr_reply`, `wr_parent`, `wr_is_comment`, `wr_comment`, `wr_comment_reply`, `ca_name`, `wr_option`, `wr_subject`, `wr_content`, `wr_link1`, `wr_link2`, `wr_link1_hit`, `wr_link2_hit`, `wr_hit`, `wr_good`, `wr_nogood`, `mb_id`, `wr_password`, `wr_name`, `wr_email`, `wr_homepage`, `wr_datetime`, `wr_file`, `wr_last`, `wr_ip`, `wr_facebook_user`, `wr_twitter_user`, `wr_1`, `wr_2`, `wr_3`, `wr_4`, `wr_5`, `wr_6`, `wr_7`, `wr_8`, `wr_9`, `wr_10`) VALUES
(1, -1, '', 1, 0, 0, '', '', 'html1', '경향신문-제주 천년숲 비자림 옆 환경성질환예방관리센터 문 열어', '<p class="content_text"><img width="527" alt="제주시 구좌읍 비자림 옆에 문 연 제주환경성질환예방관리센터." src="http://img.khan.co.kr/news/2017/10/22/l_2017102201002137100177231.jpg"></p><p class="content_text">삼림욕으로 유명한 제주 비자림 옆에 제주환경성질환예방관리센터가 문을 열었다.</p><p class="content_text">제주도는 21일 제주시 구좌읍 평대리 비자림 옛 야영장 일대 부지에 건립된 제주환경성질환예방관리센터에서 개관식을 열고 본격 운영에 돌입했다고 22일 밝혔다.</p><p class="content_text">환경성질환예방관리센터는 아토피, 천식, 비염 등과 같은 환경성 질환의 유발요인에 대해 올바른 정보를 제공하고 질환자에 대한 치료 상담, 예방관리를 위한 프로그램 등을 운영하게 된다. 100억원을 투입해 2014년 2월 건립 공사에 착수해 올 2월 완공했고 내부보강 공사를 거쳐 이번에 문 열었다.</p><p class="content_text">지하 1층, 지상 3층 규모로, 친환경 놀이강당과 각종 건강프로그램을 운영할 회의실, 대강당, 테라피시설, 검사실 등이 있다. 인형극과 자연체험, 아토피과학교실 등과 같은 예방교육프로그램, 테라피 체험과 숲치유 체험, 친환경 숙박체험, 건강캠프 등의 프로그램이 운영된다. 제주도는 또 센터가 산림욕으로 유명한 울창한 비자나무 숲 옆에 위치함으로써 시너지 효과를 낼 것으로 기대하고 있다.</p><p class="content_text">센터 운영은 제주대학교의학전문대학원 환경보건센터에서 맡는다.</p><p class="content_text">환경성질환예방관리센터는 2012년 전북 진안군에서 첫 문을 연데 이어 경기 수원, 전남 보성, 강원 동해에 이어 제주에서 다섯 번째 개관식을 가졌다.<span name="inspace_pos">&nbsp;</span></p><p class="content_text">제주는 깨끗한 자연환경을 보유하고 있음에도 불구하고 아토피 유병률과 알레르기 비염 유병률 전국 1위를 보이고 있다. 정확한 원인은 규명되지 않았지만 습한 날씨 탓에 실내에 곰팡이 발생 비율이 높고 꽃가루 알레르기를 일으키는 삼나무 등이 많이 식재된 점이 영향을 준 것으로 제주도는 보고 있다. 제주도 관계자는 “환경성질환예방관리센터가 본격 운영되면 아토피피부염과 비염환자 등 많은 도민들이 환경성 질환을 예방하고 치유하는데 도움이 될 것으로 본다”고 말했다.<br><br><br>원문보기: <br><a href="http://news.khan.co.kr/kh_news/khan_art_view.html?artid=201710221335001&amp;code=620117#csidx0d4f5c92d1810f09ca87e8d6c2c4f96">http://news.khan.co.kr/kh_news/khan_art_view.html?artid=201710221335001&amp;code=620117#csidx0d4f5c92d1810f09ca87e8d6c2c4f96 </a><img src="http://linkback.khan.co.kr/images/onebyone.gif?action_id=0d4f5c92d1810f09ca87e8d6c2c4f96"></p><p>&nbsp;</p>', '', '', 0, 0, 25, 0, 0, 'admin', '*AF0631401415FAC79CE1B9315556EACF17939505', '관리자', 'admin@domain.com', '', '2017-10-24 14:17:07', 0, '2017-10-24 14:17:07', '221.162.12.86', '', '', '', '', '', '', '', '', '', '', '', ''),
(2, -2, '', 2, 0, 0, '', '', 'html1', '제민일보-도, 21일 제주환경성질환예방관리센터 개관', '<p><img style="display: block;" src="http://www.jemin.com/news/photo/201710/475483_152513_4344.jpg" border="0"></p><p>제주특별자치도는 지난 21일 도내 아토피, 천식, 비염 등 환경성 질환자에 대한 치료 상담 및 예방관리체계를 구축하기 위한 제주환경성질환예방관리센터를 개관했다.</p><p>환경부가 2011년부터 추진한 사업인 환경성질환예방관리센터는 제주시 구좌읍 평대리 2981번지에 대지면적 9400㎡, 건축면적 3253㎡ 규모로 건립됐다. 총사업비는 100억원이 투입됐다.</p><p>수탁기관은 공모를 통해 제주대학교 환경보건센터가 선정됐다.</p><p>제주도 관계자는 "센터를 통해 환경성질환에 대한 예방관리 의식을 함양시켜 나갈 계획"이라며 "교육과 체험활동을 선보이며 치유와 힐링센터로서의 역할을 다할 것으로 기대한다"고 밝혔다. 이소진 기자&nbsp;</p>', '', '', 0, 0, 26, 0, 0, 'admin', '*AF0631401415FAC79CE1B9315556EACF17939505', '관리자', 'admin@domain.com', '', '2017-10-24 14:21:39', 0, '2017-10-24 14:21:39', '221.162.12.86', '', '', '', '', '', '', '', '', '', '', '', ''),
(3, -3, '', 3, 0, 0, '', '', 'html1', '국제뉴스-제주환경성질환예방관리센터 21일 개관 본격 운영', '<p><img src="http://www.gukjenews.com/news/photo/201710/805507_588670_424.jpg" border="1"><p>(제주=국제뉴스) 고병수 기자 = 제주특별자치도는 도내 아토피, 천식, 비염 등 환경성 질환 유발요인에 대한 올바른 정보제공과, 질환자에 대한 치료상담 및 예방관리체계 구축을 위한 “제주환경성질환예방관리센터”가 21일 개관했다고 밝혔다. 센터 개관은 전국에서 다섯 번째 개관이다. <p>개관식에는 전성택 제주도행정부지사와 허향진 제주대 총장, 김경학 제주도의원 등 많은 관계자와 함께 지역주민도 참가했다. <p>환경성질환예방관리센터는 환경부가 환경성질환 예방 관리를 위한 생활습관 및 방식에 관한 교육,체험 등 제공으로 질환치유와 예방관리 성과 제고 위해 지난 2011년부터 추진해 오고 있다.<p>제주센터는 100억 원의 사업비로 지난 2014년부터 건립공사에 착수해 2017년 2월 건물을 완공했으며 지난 9월 내부보강 공사까지 모두 마쳤다. <p>제주도는 센터운영을 위한 조례제정 및 운영자 공모를 통해 “제주대학교 의학전문대학원 환경보건센터”를 수탁기관으로 선정한 바 있다. <p>한편 제주도 관계자는 “예방관리센터가 운영되면 아토피피부염과 비염환자(보호자)들은 물론 도민들에게도 환경성질환에 대한 예방관리 의식을 함양시켜 나가게 되고 교육과 체험활동으로 도민의 건강한 삶을 위한 치유와 힐링센터로서의 역할을 다할 것”이라고 했다. </p>', '', '', 0, 0, 29, 0, 0, 'admin', '*AF0631401415FAC79CE1B9315556EACF17939505', '관리자', 'admin@domain.com', '', '2017-10-24 14:31:56', 0, '2017-10-24 14:31:56', '221.162.12.86', '', '', '', '', '', '', '', '', '', '', '', ''),
(4, -4, '', 4, 0, 0, '', '', 'html1', '헤드라인제주-제주환경성질환예방센터, 하도초 대상 행복나들이 프로그램 진행', '제주대학교 의학전문대학원 환경보건센터 ''제주환경성질환 예방관리센터''(센터장 홍성철)는 지난 6일 센터에서 구좌읍 하도초등학교 학생 40명, 학부모 32명, 교사 10명을 대상으로 교육가족 행복나들이 프로그램을 진행했다.<p>&nbsp;</p><p>행사에서는 편백인형만들기, 숲체험을 통한 아토피 및 비염 등 환경성질환에 대한 예방교육이 이뤄졌다. &lt;헤드라인제주&gt;</p>&lt;저작권자 ⓒ 헤드라인제주(<a href="http://www.headlinejeju.co.kr">http://www.headlinejeju.co.kr</a>)무단전재 및 재배포 금지&gt;										<div class="clear_both"></div><div class="arl_view_other_writers"><span class="avw_a">원성심 기자 </span></div><p>&nbsp;</p>', '', '', 0, 0, 27, 0, 0, 'admin', '*AF0631401415FAC79CE1B9315556EACF17939505', '관리자', 'admin@domain.com', '', '2017-11-10 15:06:09', 0, '2017-11-10 15:06:09', '221.162.12.86', '', '', '', '', '', '', '', '', '', '', '', ''),
(5, -5, '', 5, 0, 0, '', '', 'html1', '한라일보-제주대 환경보건센터 건강나누리캠프', '<p><img alt="" src="http://www.ihalla.com/upimages/gisaimg/201711/14-579518.jpg"></p><p>제주대학교 의학전문대학원 환경보건센터(센터장 홍성철, 환경부 지정기관)는 지난 11~12일 양일간 북한산국립공원도봉사무소, 제주환경성질환예방관리센터와 공동으로 비자숲힐링센터에서 ''건강나누리캠프''를 운영했다.<br>이번 캠프에는 아토피피부염, 알레르기비염, 천식 등 알레르기질환이 있는 도내 지역아동센터 아동 등 80여명이 참여했다.<span name="inspace_pos">&nbsp;</span><br>행사에서는 숲치유 프로그램, 알레르기 관련 검사 등 내 몸 알아보기 체험, 올바른 목욕법과 피부 관리 체험, 목공예 체험 등이 진행됐다.<br>또한 ''알레르기질환 및 미세먼지 대응법 바로알기 강좌'', ''올바른 코세척 방법 익히기'' 등 알레르기질환의 올바른 관리와 예방법을 배우는 시간을 가졌다. <br>이번 건강나누리캠프를 통해 알레르기질환을 앓고 있는 아동들은 자연에서 힐링하며 알레르기질환에 대한 올바른 정보를 익히고, 알레르기질환을 스스로 예방·관리하는 방법을 배우는 유익한 시간을 보냈다.<span name="inspace_pos">&nbsp;</span><br>제주대 의학전문대학원 환경보건센터는 환경부로부터 알레르기질환(아토피피부염, 알레르기비염) 분야로 2008년에 지정받아 알레르기질환에 대한 조사, 분석, 모니터링, 교육, 홍보를 하고 있다.<span name="inspace_pos">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 홍희선기자</span>&nbsp;</p>', '', '', 0, 0, 33, 0, 0, 'admin', '*AF0631401415FAC79CE1B9315556EACF17939505', '관리자', 'admin@domain.com', '', '2017-11-16 11:47:19', 0, '2017-11-16 11:47:19', '221.162.12.86', '', '', '', '', '', '', '', '', '', '', '', '');
