(1, -1, '', 0, 0, 0, '', '개인', 'html1', '아랑이놀이터에서 놀아요', '<div style="text-align: left; line-height: 160%; padding-bottom: 15px;">아랑이놀이터는 순수하게 자연에서 얻은 자작나무과, 소나무과, 콩과, 이우시과, 참나무과, 꼭두선이과 수종 중 예쁜 색과 결을 가진 20여종의 나무로 만든 교구들을 가지고 놀이할 수 있는 친환경 놀이 공간입니다. 또한 나무향을 맡으며 편안하게 책을 읽을 수 있는 도서공간과 아이들의 체력증진은 물론 집중력향상에도 도움을 주는 클라이밍존, 폭신폭신한 매트위에서 마음껏 구르며 뛰어놀 수 있는 매트 놀이공간과 편백칩으로 구성된 편백놀이터, 36개월 이하의 아가들만을 위한 공간인 베이비놀이터 등으로 구성되어 있습니다.</div>\r\n\r\n<div style="text-align: center; line-height: 160%; padding-bottom: 15px;">\r\n	<img src="/images/FEEL6315.png">&nbsp;&nbsp;<img src="/images/FEEL6320.png">\r\n</div>\r\n\r\n<div style="padding-bottom: 15px;">\r\n	<table width="100%" class="__se_tbl_ext" bgcolor="#e2dfd8" cellspacing="1" cellpadding="0">\r\n		<thead>\r\n		<tr height="50">\r\n			<th style="background: rgb(244, 244, 244); padding: 10px; color: rgb(94, 94, 94); font-size: 15px;">구분</th>\r\n			<th style="background: rgb(244, 244, 244); padding: 10px; color: rgb(94, 94, 94); font-size: 15px;">\r\n				<div>1회</div>\r\n				<div>10:00~12:00</div>\r\n			</th>\r\n			<th style="background: rgb(244, 244, 244); padding: 10px; color: rgb(94, 94, 94); font-size: 15px;">\r\n				<div>2회</div>\r\n				<div>13:00~15:00</div>\r\n			</th>\r\n			<th style="background: rgb(244, 244, 244); padding: 10px; color: rgb(94, 94, 94); font-size: 15px;">\r\n				<div>3회</div>\r\n				<div>15:30~17:30</div>\r\n			</th>\r\n		</tr>\r\n		</thead>\r\n		<tbody>\r\n		<tr>\r\n			<td class="col_2" style="background: rgb(255, 255, 255); font-size: 15px;">주중</td>\r\n			<td class="col_3" style="color: rgb(203, 57, 62); font-size: 15px;">단체</td>\r\n			<td class="col_4" style="color: rgb(203, 57, 62); font-size: 15px;"><span style="color: rgb(0, 0, 0);">개인</span></td>\r\n			<td class="col_4" style="font-size: 15px;">개인</td>\r\n		</tr>\r\n		<tr>\r\n			<td class="col_2" style="background: rgb(255, 255, 255); font-size: 15px;">주말</td>\r\n			<td class="col_3" style="font-size: 15px;">개인</td>\r\n			<td class="col_4" style="font-size: 15px;">개인</td>\r\n			<td class="col_4" style="font-size: 15px;">개인</td>\r\n		</tr>\r\n		</tbody>\r\n	</table>\r\n</div><div style="line-height: 160%; padding-bottom: 30px;"><div style="text-align: left; padding-top: 5px; padding-bottom: 5px; font-weight: bold;"><!--StartFragment-->&nbsp;</div><div style="text-align: left; padding-top: 5px; padding-bottom: 5px; font-weight: bold;"><img src="http://www.jejuatopycenter.kr/images/bullet_content.png">&nbsp;예약안내\r\n			</div>\r\n\r\n			<div style="text-align: left; padding-top: 5px; padding-bottom: 5px;"><img src="/images/so_bullet.png"> 예약은 월별로 한달 전부터 예약 가능하며, 홈페이지에서 신청 및 취소가 가능합니다.</div>\r\n			<div style="text-align: left; padding-top: 5px; padding-bottom: 5px;"><img src="/images/so_bullet.png"> 당일 이용은 홈페이지 사전예약 미달인원에 한하여 현장신청 가능합니다.</div>\r\n			<div style="text-align: left; padding-top: 5px; padding-bottom: 5px;"><img src="/images/so_bullet.png"> 예약취소안내: 예약을 하셨다가 취소해야 할 경우 반드시 예약신청한 시간 전까지는 취소해 주시기 바랍니다.</div>\r\n			<div style="text-align: left; padding-top: 5px; padding-bottom: 5px;"><img src="http://www.jejuatopycenter.kr/images/bullet_content.png">&nbsp;<strong>이용안내 및 안전수칙</strong></div><div style="text-align: left; padding-top: 5px; padding-bottom: 5px;"><!--StartFragment--><p class="0" style="text-indent: -70.7pt; margin-left: 70.7pt; mso-pagination: none; mso-padding-alt: 0pt 0pt 0pt 0pt;"><span style="font-size: 11pt; mso-fareast-font-family: Rix다람쥐 M;"><img src="http://www.jejuatopycenter.kr/images/so_bullet.png">&nbsp;베이비놀이터는 </span><span lang="EN-US" style="color: rgb(21, 148, 21); letter-spacing: 0pt; font-family: Rix다람쥐 M; font-size: 11pt; font-weight: bold; mso-font-width: 100%; mso-text-raise: 0pt; mso-ascii-font-family: Rix다람쥐 M;">24</span><span style="color: rgb(21, 148, 21); font-size: 11pt; font-weight: bold; mso-fareast-font-family: Rix다람쥐 M;">개월 이하</span><span style="font-size: 11pt; mso-fareast-font-family: Rix다람쥐 M;">의 영아들이 사용하는 공간입니다</span><span lang="EN-US" style="letter-spacing: 0pt; font-family: Rix다람쥐 M; font-size: 11pt; mso-font-width: 100%; mso-text-raise: 0pt; mso-ascii-font-family: Rix다람쥐 M;">. </span></p></div><div style="text-align: left; padding-top: 5px; padding-bottom: 5px;"><img src="/images/so_bullet.png"> 놀이터 내에는 반드시 보호자가 동반 입장하여야 합니다. 자녀 1명당 보호자 1명이 동반하셔야 되시며, 자녀가 2명일 경우 보호자가 2명이 동반하시되 보호자 1명이 2명 모두 케어 가능하시면 이용 가능합니다. </div>\r\n			<div style="text-align: left; padding-top: 5px; padding-bottom: 5px;"><img src="/images/so_bullet.png"> 놀이터 이용 중 안전사고 발생 시 책임은 보호자(인솔자)에게 있습니다.</div>\r\n			<div style="text-align: left; padding-top: 5px; padding-bottom: 5px;"><img src="/images/so_bullet.png"> 놀이터 내에 비치된 교구 또는 물품이 파손, 훼손 되지 않도록 주의해 주시고 사용 후에는 아이들과 함께 제자리에 정리해 주시기 바랍니다.</div>\r\n			<div style="text-align: left; padding-top: 5px; padding-bottom: 5px;"><img src="/images/so_bullet.png"> 이용 시간 후에는 정리 및 소독 시간입니다. 다른 회차 이용자들을 위해 이용시간을 준수해 주시기 바랍니다.</div>\r\n			<div style="text-align: left; padding-top: 5px; padding-bottom: 5px;"><img src="/images/so_bullet.png"> 단체는 월 2회, 개인은 일 1회 이용 가능합니다.</div>\r\n			<div style="text-align: left; padding-top: 5px; padding-bottom: 5px;"><img src="/images/so_bullet.png"> 영유아들에게 쾌적한 놀이환경을 제공하고자 놀이터 내 음식물 반입은 금지합니다.</div>\r\n\r\n</div>', '', '', 0, 0, 14, 0, 0, 'admin', '*AF0631401415FAC79CE1B9315556EACF17939505', '관리자', 'admin@domain.com', '', '2017-10-30 10:49:27', 0, '2017-10-30 10:49:27', '58.225.18.10', '', '', '1세-7세', '연중', 'Y', '입장료 2,000<br/>(보호자 무료)', '', '매회 20명', '', '', '', ''),
(2, -2, '', 2, 0, 0, '', '개인', 'html1', '다랑이 놀이터에서 놀아요', '<div style="text-align: left; line-height: 160%; padding-bottom: 15px;">다랑이놀이터는 첨단 강화섬유 로프로 짠 그물로 만드는 제품들로 구성된 놀이 공간으로 화려하고 예쁜 색깔, 독특하고 입체적인 비주얼, 부드러운 촉감, 그물 특유의 출렁거림, 흥미진진한 탐험구조 등 아이들이 좋아할 만 한 점을 두루 갖춘 실내용 프리미엄 고급놀이기구로 구성되었습니다.</div>\r\n\r\n<div style="text-align: center; line-height: 160%; padding-bottom: 15px;">\r\n	<img src="/images/FEEL6346.png">&nbsp;&nbsp;<img src="/images/FEEL6350.png">\r\n</div>\r\n\r\n			<div style="padding-bottom: 15px;">\r\n				<table width="100%" class="__se_tbl_ext" bgcolor="#e2dfd8" cellspacing="1" cellpadding="0">\r\n					<thead>\r\n					<tr height="50">\r\n						<th style="background: rgb(244, 244, 244); padding: 10px; color: rgb(94, 94, 94); font-size: 15px;">구분</th>\r\n						<th style="background: rgb(244, 244, 244); padding: 10px; color: rgb(94, 94, 94); font-size: 15px;">\r\n							<div>1회</div>\r\n							<div>10:00~12:00</div>\r\n						</th>\r\n						<th style="background: rgb(244, 244, 244); padding: 10px; color: rgb(94, 94, 94); font-size: 15px;">\r\n							<div>2회</div>\r\n							<div>13:00~15:00</div>\r\n						</th>\r\n						<th style="background: rgb(244, 244, 244); padding: 10px; color: rgb(94, 94, 94); font-size: 15px;">\r\n							<div>3회</div>\r\n							<div>15:30~17:30</div>\r\n						</th>\r\n					</tr>\r\n					</thead>\r\n					<tbody>\r\n					<tr>\r\n						<td class="col_2" style="background: rgb(255, 255, 255); font-size: 15px;">주중</td>\r\n						<td class="col_3" style="color: rgb(203, 57, 62); font-size: 15px;">단체</td>\r\n						<td class="col_4" style="color: rgb(203, 57, 62); font-size: 15px;"><span style="color: rgb(0, 0, 0);">개인</span></td>\r\n						<td class="col_4" style="font-size: 15px;">개인</td>\r\n					</tr>\r\n					<tr>\r\n						<td class="col_2" style="background: rgb(255, 255, 255); font-size: 15px;">주말</td>\r\n						<td class="col_3" style="font-size: 15px;">개인</td>\r\n						<td class="col_4" style="font-size: 15px;">개인</td>\r\n						<td class="col_4" style="font-size: 15px;">개인</td>\r\n					</tr>\r\n					</tbody>\r\n				</table><p>\r\n&nbsp;	</p><!--StartFragment--><p>&nbsp;</p></div><div style="line-height: 160%; padding-bottom: 15px;"><div style="text-align: left; padding-top: 5px; padding-bottom: 5px; font-weight: bold;"><img src="/images/bullet_content.png"> 예약안내\r\n				</div>\r\n\r\n				<div style="text-align: left; padding-top: 5px; padding-bottom: 5px;"><img src="/images/so_bullet.png"> 예약은 월별로 한달 전부터 예약 가능하며, 홈페이지에서 신청 및 취소가 가능합니다.</div>\r\n				<div style="text-align: left; padding-top: 5px; padding-bottom: 5px;"><img src="/images/so_bullet.png"> 예약취소안내: 예약을 하셨다가 취소해야 할 경우, 반드시 예약신청한 시간 전까지는 취소해 주시기 바랍니다.</div>\r\n			</div>\r\n			\r\n			<div style="line-height: 160%; padding-bottom: 15px;">\r\n				<div style="text-align: left; line-height: 160%; padding-top: 5px; padding-bottom: 5px; font-weight: bold;">\r\n					<img src="/images/bullet_content.png"> 이용안내 및 안전수칙\r\n				</div>\r\n\r\n				<div style="text-align: left; padding-top: 5px; padding-bottom: 5px;"><img src="/images/so_bullet.png"> 다른 어린이들을 밀거나 잡지 않습니다.</div>\r\n				<div style="text-align: left; padding-top: 5px; padding-bottom: 5px;"><img src="/images/so_bullet.png"> 그물 밖으로 매달리거나 뛰어내리지 않습니다.</div>\r\n				<div style="text-align: left; padding-top: 5px; padding-bottom: 5px;"><img src="/images/so_bullet.png"> 놀이터 이용 중 안전사고 발생 시 책임은 보호자(인솔자)에게 있습니다.</div>\r\n				<div style="text-align: left; padding-top: 5px; padding-bottom: 5px;"><img src="/images/so_bullet.png"> 이용 시간 후에는 정리 및 소독 시간입니다. 다른 회차 이용자들을 위해 이용시간을 준수해 주시기 바랍니다.</div>\r\n				<div style="text-align: left; padding-top: 5px; padding-bottom: 5px;"><img src="/images/so_bullet.png"> 단체는 월 2회, 개인은 일 1회 이용 가능합니다.</div>\r\n				<div style="text-align: left; padding-top: 5px; padding-bottom: 5px;"><img src="/images/so_bullet.png"> 영유아들에게 쾌적한 놀이환경을 제공하고자 놀이터 내 음식물 반입은 금지입니다.</div>\r\n			</div>', '', '', 0, 0, 10, 0, 0, 'admin', '*AF0631401415FAC79CE1B9315556EACF17939505', '관리자', 'admin@domain.com